window.bookSummaryJSON = "<p>The third in the Witches of Karres homage series, this is a rollicking romp through the outer reaches of the galaxy. </p> <p>If he’d known he was getting stuck with a pair of psi-wielding super-beings, even straitlaced do-gooder Captain Pausert might have thought twice about rescuing his two young “witch” charges from slavery on a dark planet. </p> <p>But what’s done is done - and with galactic peace once again threatened in the mysterious and pirate-ridden Chaladoor region, only a dangerous mission backward in time can save the present and - maybe - get stalwart-but-obtuse Pausert to see one of these young “witches” as more than just a friend.</p>"; 
